import React, { Component } from 'react';
class Register extends Component {
    constructor(props) {
        super(props);
        this.state = {  }
    }
    render() { 
        return ( 
           <div>
                <div className="container">
                  <h3>Create New Account</h3>
                  <div>
                      <form action="">
                      <div style={{float:"left",padding:"10px",width:"50%"}}>
                      <label for="fname">First Name </label>
				        <input type="text" id="fname" name="first_name"  className="form-control form-control-lg" style={{width:"100%"}}/>
                    </div>
                    <div style={{float:"left",padding:"10px",width:"50%"}}>
                    <label for="fname">Last Name</label>
				        <input type="text" id="lname" name="last_name"  className="form-control form-control-lg" style={{width:"100%"}}/>
                    </div>
                    <div style={{float:"left",padding:"10px",width:"50%"}}>
                    <label for="fname">Email</label><br/>
				        <input type="text" id="email" name="email"  className="form-control form-control-lg" style={{width:"100%"}}/>
                    </div>
                    <div style={{float:"left",padding:"10px",width:"50%"}}>
                    <label for="fname">Phone number</label><br/>
				        <input type="text" id="contact" name="contact"  className="form-control form-control-lg" style={{width:"100%"}}/>
                    </div>
                      </form>
                  </div>
                </div>
           </div>
         );
    }
}
 
export default Register;
